         y="818.09033"
         sodipodi:role="line"
         id="tspan4473">is a hormone that assists in regulating both appetite and metabolism.</tspan>

         id="tspan4475">Leptin levels are generally proportional to body fat, as leptin is released by fat</tspan>

             sodipodi:role="line"
             id="tspan7651">accumulates in various tissues in the body, including the kidneys,</tspan>
          <tspan
             style="font-size:10px;font-variant:normal;font-weight:300;font-stretch:normal;writing-mode:lr-tb;fill:#000000;fill-opacity:1;fill-rule:nonzero;stroke:none;font-family:Myriad Pro Light;-inkscape-font-specification:MyriadPro-Light"

             y="14"
             sodipodi:role="line"
             id="tspan7653">brain, lungs, liver and thyroid. Aluminum excess can result in reduced skeletal</tspan>
          <tspan
             style="font-size:10px;font-variant:normal;font-weight:300;font-stretch:normal;writing-mode:lr-tb;fill:#000000;fill-opacity:1;fill-rule:nonzero;stroke:none;font-family:Myriad Pro Light;-inkscape-font-specification:MyriadPro-Light"

             y="28"
             sodipodi:role="line"
             id="tspan7655">mineralization and Alzheimer's disease.</tspan>

             y="0"
             sodipodi:role="line"

          <tspan
             style="font-size:10px;font-variant:normal;font-weight:300;font-stretch:normal;writing-mode:lr-tb;fill:#000000;fill-opacity:1;fill-rule:nonzero;stroke:none;font-family:Myriad Pro Light;-inkscape-font-specification:MyriadPro-Light"

             y="14"
             sodipodi:role="line"
             id="tspan7665">major killer diseases such as heart disease, cancer and diabetes. Most heavy</tspan>

             y="28"

             y="42"
             sodipodi:role="line"
             id="tspan7669">Fibromyalgia and CFS.</tspan>
